import fStyle from "./FormItem.module.css";
import Input from "../../UI/Input";

const FormItem = (props) => {
  return (
    <form className={fStyle.form}>
      <Input
        label="Jumlah"
        input={{
          id: "total",
          type: `number`,
          min: "1",
          max: "5",
          step: "1",
          defaultValue: "1",
        }}
      />
      <button>+ Add</button>
    </form>
  );
};

export default FormItem;
